import React from 'react';

const CallDetails = ({ title, comment, status, priority }) => {
  return (
    <div>
      <h2>Detalhes do Chamado</h2>
      <p>Título: {title}</p>
      <p>Comentário: {comment}</p>
      <p>Status: {status}</p>
      <p>Prioridade: {priority}</p>
    </div>
  );
};

export default CallDetails;
